	(1,'获取一级类目',1,'**简要描述：**\r\n\r\n- 获取一级类目\r\n\r\n**请求URL：**\r\n- ` general/GetFirstCategory`\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\n{\r\n\"token\":\"12345678901234567890123456789012\",\r\n\"areaCode\":\"CS000016-0-0-0\",\r\n\"body\":{\r\n\"versionNo\": \"848161c77c5928a384e4d6bfff759dbeCS000016\"\r\n}\r\n}\r\n\r\n```\r\n\r\n**参数：**\r\n\r\n|参数名|必选|类型|说明|\r\n|:----    |:---|:----- |-----   |\r\n|versionNo|是|string|版本号|\r\n\r\n\r\n **返回示例**\r\n\r\n```\r\n{\r\n    \"elapsedTime\": \"0.0880\",\r\n    \"errorCode\": 0,\r\n    \"errorDesc\": \"\",\r\n    \"body\": {\r\n        \"CategoryList\": [\r\n            {\r\n                \"siSeq\": \"xxx\",\r\n                \"type\": 0,\r\n                \"appName\": \"热门分类\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C19510\",\r\n                \"type\": 1,\r\n                \"appName\": \"母婴、玩具\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C19416\",\r\n                \"type\": 1,\r\n                \"appName\": \"鞋靴、箱包\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C77199\",\r\n                \"type\": 1,\r\n                \"appName\": \"（无线测试用）\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C56778\",\r\n                \"type\": 1,\r\n                \"appName\": \"shirley测试群组\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C76726\",\r\n                \"type\": 1,\r\n                \"appName\": \"路飞测试\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C76918\",\r\n                \"type\": 1,\r\n                \"appName\": \"CATEGOTYTEST\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C19400\",\r\n                \"type\": 1,\r\n                \"appName\": \"手机、数码、配件\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C19322\",\r\n                \"type\": 1,\r\n                \"appName\": \"生鲜、冷冻食品、海鲜\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C19411\",\r\n                \"type\": 1,\r\n                \"appName\": \"食品、酒水、切糕\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C19558\",\r\n                \"type\": 1,\r\n                \"appName\": \"家用电器\"\r\n            },\r\n            {\r\n                \"siSeq\": \"C53328\",\r\n                \"type\": 1,\r\n                \"appName\": \"操作日志测试\"\r\n            }\r\n        ],\r\n\"versionNo\": \"848161c77c5928a384e4d6bfff759dbeCS000016\"\r\n    }\r\n}\r\n\r\n```\r\n\r\n **返回参数说明**\r\n\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----|\r\n|CategoryList|CategoryList|siSeq 分类id appName 类目名称 type 类型 0：热门分类 1：一般分类 一级类目列表|\r\n\r\n######CategoryList\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----|\r\n|siSeq|string|分类id|\r\n|appName|string|类目名称|\r\n|type|int|类型 0：热门分类 1：一般分类 一级类目列表|\r\n\r\n **备注**\r\n\r\n\r\n',0,5,1,'2016-03-07 14:56:16','2016-03-07 14:56:16'),
	(2,'获取二三级类目',2,'**简要描述：**\r\n\r\n- 常用分类接口由大数据提供，api不再提供\r\n\r\n**请求URL：**\r\n- ` general/GetChildCategory`\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\n{\r\n\"token\":\"12345678901234567890123456789012\",\r\n\"body\":\r\n{\r\n\"siSeq\":\" CG100483\",\r\n\"type\":1,\r\n\"versionNo\":\"\"\r\n}\r\n}\r\n\r\n```\r\n\r\n**参数：**\r\n\r\n|参数名|必选|类型|默认值|说明|\r\n|:----    |:---|:----- |:----- |-----   |\r\n|siSeq|是|string|0|一级类目id|\r\n|type|是|int|1|0：热门类目 1：一般类目 |\r\n|version|是|string||版本信息|\r\n **返回示例**\r\n\r\n```\r\n  {\r\n    \"elapsedTime\": \"0.0905\",\r\n    \"errorCode\": 0,\r\n    \"errorDesc\": \"\",\r\n    \"body\": {\r\n		\"versionNo\": \"848161c77c5928a384e4d6bfff759dbeCS000016\",\r\n		\"parentSiSeq\": \" C19322\",\r\n		\"isHasBanner\": 1，\r\n        \"CategoryTree\": [\r\n            {\r\n                \"siSeq\": \"C76845\",\r\n                \"type\": 1,\r\n                \"appName\": \"自订馆测试\",\r\n				\"hasMore\":1,\r\n                \"child\": []\r\n            },\r\n            {\r\n                \"siSeq\": \"C76656\",\r\n                \"type\": 1,\r\n                \"appName\": \"test_20092\",\r\n				\"hasMore\":1,\r\n                \"child\": [\r\n                    {\r\n                        \"siSeq\": \"C76680\",\r\n                        \"type\": 1,\r\n                        \"appName\": \"12\",\r\n                        \"icon\": \"/C/web/layout/kk/20150903/20150903093621_kk-1.png\"\r\n                    },\r\n                    {\r\n                        \"siSeq\": \"C76667\",\r\n                        \"type\": 1,\r\n                        \"appName\": \"tests_20092\",\r\n                        \"icon\": \"/C/web/layout/kk/20150903/20150903093621_kk-1.png\"\r\n                    }\r\n                ]\r\n            }\r\n        ],\r\n        \"banner\": {\r\n            \"picUrl\": \"/C/web/layout/kk/20150903/20150903093621_kk-1.png\",\r\n            \"link\": \"http://www.xxx.com\",\r\n            \"bannerType\": 1\r\n        }\r\n    }\r\n}\r\n\r\n```\r\n\r\n **返回参数说明**\r\n\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|CategoryTree|CategoryTree[]|二三级类目|\r\n|banner|banner|广告位|\r\n|versionNo|string|版本号|\r\n|parentSiSeq|string|请求一级类目编号|\r\n|isHasBanner|int|是否有广告位 1：有 0：没有|\r\n\r\n###### CategoryTree\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|siSeq |string|类目id|\r\n|appName|string| 首选名称|\r\n|type|int|1：常用类目2：推荐类目3：一般类目|\r\n|hasMore|int| 是否有全部商品（1：有全部商品，0：没有商品）|\r\n|child|child[]|三级类目信息\r\n\r\n###### child\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|siSeq |string|类目id|\r\n|appName|string| 首选名称|\r\n|type|int|1：常用类目2：推荐类目3：一般类目|\r\n|icon|string|三级类目图片\r\n###### banner\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----|\r\n|picUrl|string| 广告位图片|\r\n|link|string| 广告活动url地址|\r\n|type|int|广告活动的类型（控制跳转的关键）\r\n\r\n **备注**\r\n\r\n\r\n',0,5,1,'2016-03-07 14:56:44','2016-03-07 14:56:44'),
	(3,'全局声明版本说明',0,'**简要描述：**\r\n\r\n###### 触屏版无版本之分，永远都只取得最新的版本(包括beta 和 online)\r\n\r\n**参数：**\r\n\r\n|apiVersion版本号|上线时间|app客户端类型|客户端版本号|\r\n|:----    |:---|:----- |-----   |\r\n|a5.01 |2016-02-19  |android |2.1.1   |\r\n|a5.02 |2016-03-24  |android |2.1.3   |\r\n|i5.01 |2016-02-19  |ios |2.1.1   |\r\n|i5.02 |2016-03-24  |ios |2.1.3   |\r\n\r\n\r\n\r\n',0,5,2,'2016-03-07 15:45:26','2016-03-07 15:45:26'),
	(4,'用户APP注册接口',3,'**简要描述：**\r\n\r\n- 用户APP注册接口\r\n\r\n**请求URL：**\r\n- ` regController/register `\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\n{\r\n    \"apiVersion\": \"a5.01\",\r\n    \"areaCode\": \"CS000018-320600-320698-0\",\r\n    \"token\": \"ccfb5a0eef8a2da0a4c1aa40bdb5bbca\",\r\n    \"device_id\": \"H5_1450852779020tW2GAoMw40\",\r\n    \"body\": {\r\n        \"username\": \"18659842564\",\r\n        \"password\": \"2321312312qwe\",\r\n        \"captcha\": \"8267\",\r\n        \"img_captcha\": \"mkut\",\r\n        \"osType\": 3,\r\n        \"channel\": \"\",\r\n	\"invitation\":\"王二\",\r\n	\"inviteId\":\"13813800138\"\r\n    }\r\n}\r\n```\r\n\r\n**参数：**\r\n\r\n|参数名|必选|类型|默认值|说明|\r\n|:----    |:---|:----- |:---|-----   |\r\n|username |是  |string ||用户名   |\r\n|password |是  |string || 密码    |\r\n|captcha     |否  |string || 短信验证码    |\r\n|img_captcha     |否  |string || 图片验证码（如果前端不显示图片验证码，则这个字段传空）    |\r\n|invitation     |否  |string || 合伙人—邀请人    |\r\n|inviteId     |否  |string || 合伙人-邀请人id    |\r\n\r\n **返回示例**\r\n\r\n```\r\n{\r\n    \"elapsedTime\": 8908,\r\n    \"errorCode\": 0,\r\n    \"errorDesc\": \"注册成功！\",\r\n    \"body\": {\r\n        \"mem_guid\": \"EE84A146-A5AE-4C7E-5024-6EDD3B978D04\",\r\n        \"isMultiple\": 0,\r\n        \"token\": \"db1d739b1a6fe931e8d89cbc2ff47bbb\",\r\n        \"msgID\": \"\",\r\n        \"msgText\": \"\"\r\n    }\r\n}\r\n\r\n```\r\n\r\n **返回参数说明**\r\n\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|token |string   |注册成功后返回Token_user（自动登录）|\r\n|msgID |int   |1: 首次登入优惠券 2: 首次登入购物金 3：首次登入抵用券 4：首次登入购物卡|\r\n|msgText |string   |讯息详细内容  |\r\n\r\n **备注**\r\n\r\n\r\n',0,5,12,'2016-03-07 16:24:53','2016-03-07 16:24:53'),
	(5,'登录/登出',3,'**简要描述：**\r\n\r\n- 用户登录/登出接口\r\n\r\n**请求URL：**\r\n- ` loginAction/login `\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\ndata：\r\n{\r\n    \"apiVersion\": \"t5.01\",\r\n    \"areaCode\": \"CS000016-310100-310101-0\",\r\n    \"token\": \"1cf9458ab117479e3475cf82b7e95a1e\",\r\n    \"body\": {\r\n        \"username\": \"1qq@qq.com\",\r\n        \"password\": \"qwe789\",\r\n        \"captcha\": \"\",\r\n        \"osType\": 3\r\n    }\r\n}\r\nparamsMD5：\r\n85211af5a62146382803748be744321e\r\n```\r\n\r\n**参数：**\r\n\r\n|参数名|必选|类型|默认值|说明|\r\n|:----    |:---|:----- |:---|-----   |\r\n|username |是  |string ||非空时登录   |\r\n|password |是  |string || 密码（为空时登出）|\r\n|captcha     |否  |string ||  登录接口失败超过指定次数,返回此errorCode:9003前端则显示图片验证码   |\r\n\r\n **返回示例**\r\n\r\n```\r\n{\r\n    \"elapsedTime\": 84,\r\n    \"errorCode\": 0,\r\n    \"errorDesc\": \"登陆成功！\",\r\n    \"body\": {\r\n        \"mem_guid\": \"ADAC88C6-564D-4E5B-3530-4FEC331AE4C7\",\r\n        \"authcode\": \"7snpXwUKl7DHU4Ghe0eC1ngYQw6fRj95YeUIFMkRtYwh6SYdbBUwU6xNRhM5MAyOW43wASWO5JoB7X36Lswl7NyxlTUbcD7/lTsvBJWNCmIPBPJwTff69rSX4mmqzzXY3is=\",\r\n        \"isMultiple\": 0,\r\n        \"token\": \"9ac7ff09521c59218ab225bc792872f4\",\r\n        \"msgID\": \"\",\r\n        \"msgText\": \"\"\r\n    }\r\n}\r\n```\r\n\r\n **返回参数说明**\r\n\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|token |string   |登录成功后返回新Token_user,登出成功后返回Token_device  |\r\n|msgID |int   |1: 首次登入优惠券 2: 首次登入购物金 3：首次登入抵用券 4：首次登入购物卡|\r\n|msgText |string   |讯息详细内容  |\r\n|isMultiple |int   |是否送多个券,1-是，0-否  |\r\n|mem_guid |string   |用户GUID |\r\n|authcode |string   | 此字段触屏会用到 |\r\n\r\n\r\n **备注**\r\n\r\n\r\n',0,5,12,'2016-03-08 09:32:53','2016-03-08 09:32:53'),
	(6,'我的账户',4,'**简要描述：**\r\n\r\n- 我的账户\r\n\r\n**请求URL：**\r\n- ` misc/memberIndex `\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\ndata：\r\n{\r\n    \"token\":\"12345678901234567890123456789012\",\r\n    \"areaCode\":\"CS000016-0-0-0\",\r\n    \"body\":{}\r\n}\r\nparamsMD5：\r\n85211af5a62146382803748be744321e\r\n```\r\n\r\n**参数：**\r\n\r\n|参数名|必选|类型|默认值|说明|\r\n|:----    |:---|:----- |:---|-----|\r\n|||||||\r\n\r\n **返回示例**\r\n\r\n```\r\n{\r\n    \"elapsedTime\": 339,\r\n    \"errorCode\": 0,\r\n    \"errorDesc\": \"\",\r\n    \"body\": {\r\n        \"module\": [\r\n            {\r\n                \"title\": \"我的订单\",\r\n                \"type\": 1\r\n            },\r\n            {\r\n                \"title\": \"我的资产\",\r\n                \"type\": 2\r\n            },\r\n            {\r\n                \"title\": \"自定义模块\",\r\n                \"struct\": [\r\n                    {\r\n                        \"content\": \"http://test.m.feiniu.com/my/member/index.html\",\r\n                        \"title\": \"会员俱乐部\",\r\n                        \"titles\": \"会员特权礼包\",\r\n                        \"pic\": \"http://member-fnapp.feiniugo.com/images/myaccount_icon/h5/icon_member.png\",\r\n                        \"type\": 1\r\n                    },\r\n                    {\r\n                        \"content\": \"\",\r\n                        \"title\": \"我的预约\",\r\n                        \"titles\": \"\",\r\n                        \"pic\": \"http://member-fnapp.feiniugo.com/images/myaccount_icon/h5/icon_time.png\",\r\n                        \"type\": 4\r\n                    },\r\n                    {\r\n                        \"content\": \"http://test.m.feiniu.com/groupon/myroom.html\",\r\n                        \"title\": \"我的组团\",\r\n                        \"titles\": \"\",\r\n                        \"pic\": \"http://member-fnapp.feiniugo.com/images/myaccount_icon/h5/icon_tuan.png\",\r\n                        \"type\": 5\r\n                    },\r\n                    {\r\n                        \"content\": \"\",\r\n                        \"title\": \"曾经购买\",\r\n                        \"titles\": \"\",\r\n                        \"pic\": \"http://member-fnapp.feiniugo.com/images/myaccount_icon/h5/icon_buy.png\",\r\n                        \"type\": 14\r\n                    },\r\n                    {\r\n                        \"content\": \"\",\r\n                        \"title\": \"个人信息\",\r\n                        \"titles\": \"收货地址管理\",\r\n                        \"pic\": \"http://member-fnapp.feiniugo.com/images/myaccount_icon/h5/icon_personal.png\",\r\n                        \"type\": 6\r\n                    },\r\n                    {\r\n                        \"content\": \"\",\r\n                        \"title\": \"帮助中心\",\r\n                        \"titles\": \"\",\r\n                        \"pic\": \"http://member-fnapp.feiniugo.com/images/myaccount_icon/h5/icon_help.png\",\r\n                        \"type\": 7\r\n                    }\r\n                ],\r\n                \"type\": 3\r\n            }\r\n        ],\r\n        \"head\": {\r\n            \"signAddScore\": \"\",\r\n            \"mallCount\": 1,\r\n            \"isSigned\": 0,\r\n            \"itemCount\": 62,\r\n            \"allScore\": 1361\r\n        },\r\n        \"userInfo\": {\r\n            \"memLevelIcon\": \"http://member-fnapp.feiniugo.com/images/myaccount_icon/h5/icon_t1.png\",\r\n            \"memberClubUrl\": \"http://test.m.feiniu.com/my/member/index.html\",\r\n            \"mem_name\": \"1qq@qq.com\",\r\n            \"sex\": \"\",\r\n            \"isExist\": 1,\r\n            \"nickname\": \"1qq@qq.com\",\r\n            \"userCellphone\": \"\",\r\n            \"issetPassword\": 1,\r\n            \"userEmail\": \"1qq@qq.com\",\r\n            \"moumouUrl\": \"http://test.im.m.feiniu.com/webim/merchantList\",\r\n            \"userType\": 1,\r\n            \"isvvip\": 0,\r\n            \"moumouNewMsg\"