|\r\n|nickname |string   |昵称  |\r\n|userType |int   |1：邮箱 2：手机 3：普通帐号|\r\n|sex |string   |性别|\r\n|head_portrait |string   |用户头像  |\r\n|userCellphone |string   |用户绑定的手机号 |\r\n|userEmail |string   |用户绑定的邮箱|\r\n|issetPassword |int   |是否设置密码|\r\n|moumouNewMsg |int   |哞哞新消息数量 |\r\n|moumouUrl |string   |哞哞H5链接  |\r\n|is_employee |int   |是否为员工 1：是 0：否 |\r\n|isvvip |int   |1:是 0:否 |\r\n\r\norderSummary\r\n\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|orderType |int   |订单类型 1：全部 2：待付款 3：待收货 4：已完成 5：退货中（用于退订单） 6：已退货（用于退订单） 7：待发货|\r\n|count |int   | 订单数量|\r\n\r\n **备注**\r\n',0,5,12,'2016-03-08 13:46:19','2016-03-08 13:46:19'),
