	(8,'检查APP注册是否需要显示图片验证码',5,'**简要描述：**\r\n\r\n- 检查APP注册是否需要显示图片验证码\r\n\r\n**请求URL：**\r\n- ` regController/isshowregistpiccaptcha `\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\n无\r\n```\r\n\r\n**参数：**\r\n\r\n\r\n\r\n **返回示例**\r\n\r\n```\r\n{\r\n  \"elapsedTime\": 0,\r\n  \"errorCode\": 0,\r\n  \"errorDesc\": \"错误信息\",\r\n  \"body\": {\r\n		\"isShowRegistPicCaptcha\":1\r\n  }\r\n}\r\n\r\n```\r\n\r\n **返回参数说明**\r\n\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|isShowRegistPicCaptcha |int   |1：是 0：否  |\r\n\r\n **备注**\r\n',0,5,6,'2016-03-08 15:30:00','2016-03-08 15:30:00'),
	(9,'验证码requestSource参数说明',5,'**简要描述：**\r\n\r\n1:登录(图片)\r\n\r\n2:注册(图片)\r\n\r\n3:注册(短信)\r\n\r\n4:忘记密码(图片)\r\n\r\n5:忘记密码(短信)\r\n\r\n6:忘记密码(邮箱)\r\n\r\n7:绑定手机(短信)\r\n\r\n8:修改支付密码(邮箱)\r\n\r\n9:修改支付密码(短信)\r\n\r\n10: 购物卡充值(图片)\r\n\r\n11:预约商品(短信)\r\n\r\n12:微信活动(图片)\r\n\r\n13:微信活动(短信)\r\n\r\n14:提交订单(图片)\r\n\r\n15:快捷登录(短信)\r\n\r\n16.注册(图片短信) // App注册需要获取短信时需要传入图片验证码则使用16，如果不需要传图片验证码则获取注册短信使用3\r\n\r\n17.微信活动(图片扭曲)\r\n',0,5,6,'2016-03-08 15:36:38','2016-03-08 15:36:38'),
	(10,'获取验证码',5,'**简要描述：**\r\n\r\n- 获取验证码\r\n\r\n**请求URL：**\r\n- ` misc/getcaptcha `\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\n{\r\n    \"token\": \"533f565afed6b873023794ae048bd14b\",\r\n    \"body\": {\r\n        \"username\": \"shenhui.yang@feiniu.com\",\r\n        \"userType\": \"\",\r\n        \"action\": \"2\",\r\n        \"requestSource\": \"3\",\r\n		\"img_captcha\":\"asds\"\r\n    }\r\n}\r\n```\r\n\r\n**参数：**\r\n\r\n|参数名|必选|类型|默认值|说明|\r\n|:----    |:---|:----- |:---|-----   |\r\n|username |否  |string |空|为手机号码时发送短信验证码、为邮箱时发送邮件、为空时返回图形验证码url|\r\n|userType |否  |string |空|有值则返回响应的username，1：邮箱 2：手机    |\r\n|action     |否  |int |0| 0：无操作 1：注册时检测用户名、绑定手机时检查 2：重设密码时检测用户名    |\r\n|requestSource |是  |int ||   |\r\n|img_captcha     |否  |string |空|当requestSource等于16的时候需要传如图片验证码 |\r\n\r\n **返回示例**\r\n\r\n```\r\n{\r\n    \"elapsedTime\": \"0.2728\",\r\n    \"errorCode\": 0,\r\n    \"errorDesc\": \"成功\",\r\n    \"body\": {\r\n        \"captchaUrl\": \"http://gapp.feiniugo.com/misc/GetCaptcha?data=%7B%22token%22%3A%2212345678901234567890123456789012%22%2C%22body%22%3A%7B%22isImg%22%3A1%7D%7D\"\r\n    }\r\n}\r\n```\r\n\r\n **返回参数说明**\r\n\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|captchaUrl |string   |图形验证码url|\r\n\r\n **备注**\r\n',0,5,6,'2016-03-08 15:44:29','2016-03-08 15:44:29'),
	(11,'触屏注册获取验证码',5,'**简要描述：**\r\n\r\n- 触屏注册获取验证码\r\n\r\n**请求URL：**\r\n- ` misc/getcaptcha2 `\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\n{\r\n    \"token\": \"533f565afed6b873023794ae048bd14b\",\r\n    \"body\": {\r\n        \"username\": \"shenhui.yang@feiniu.com\",\r\n        \"userType\": \"\",\r\n        \"action\": \"2\",\r\n        \"requestSource\": \"3\",\r\n        \"img_captcha\": \"3222\",\r\n        \"activity\": \"1\"\r\n    }\r\n}\r\n```\r\n\r\n**参数：**\r\n\r\n|参数名|必选|类型|默认值|说明|\r\n|:----    |:---|:----- |:---|-----   |\r\n|username |否  |string |空|为手机号码时发送短信验证码、为邮箱时发送邮件、为空时返回图形验证码url|\r\n|userType |否  |string |空|有值则返回响应的username，1：邮箱 2：手机    |\r\n|action     |否  |int |0| 0：无操作 1：注册时检测用户名、绑定手机时检查 2：重设密码时检测用户名    |\r\n|requestSource |是  |int ||   |\r\n|img_captcha     |否  |string |空|图片验证码 |\r\n|activity     |否  |string |空|1: 分享赠券（暂时只有这个活动） |\r\n\r\n **返回示例**\r\n\r\n```\r\n{\r\n    \"elapsedTime\": \"0.2728\",\r\n    \"errorCode\": 0,\r\n    \"errorDesc\": \"成功\",\r\n    \"body\": {\r\n        \"captchaUrl\": \"http://gapp.feiniugo.com/misc/GetCaptcha?data=%7B%22token%22%3A%2212345678901234567890123456789012%22%2C%22body%22%3A%7B%22isImg%22%3A1%7D%7D\"\r\n    }\r\n}\r\n```\r\n\r\n **返回参数说明**\r\n\r\n|参数名|类型|说明|\r\n|:-----  |:-----|-----                           |\r\n|captchaUrl |string   |图形验证码url|\r\n\r\n **备注**\r\n',0,5,6,'2016-03-08 15:49:19','2016-03-08 15:49:20'),
	(12,'发送验证码',5,'**简要描述：**\r\n\r\n- 发送验证码\r\n\r\n**请求URL：**\r\n- ` userinfo/sendcaptcha `\r\n\r\n**请求方式：**\r\n- POST\r\n\r\n**请求示例**\r\n\r\n```\r\n{\r\n    \"token\": \"40d7a261a0cb141e64b6274cbf9fdf87\",\r\n	\"body\": {\r\n		\"cellphone\":\"18818881888\",\r\n		\"isBindPhone\":0,\r\n		\"requestSource\":\"\"\r\n    }\r\n}\r\n```\r\n\r\n**参数：**\r\n\r\n|参数名|必选|类型|默认值|说明|\r\n|:----    |:---|:----- |:---|-----   |\r\n|cellphone |是  |string ||手机号/邮箱（为了兼容设置支付密码和修改支付密码）   |\r\n|isBindPhone |是  |int || 是否绑定手机 0 未绑定 1 绑定手机 2 绑定邮箱    |\r\n|requestSource     |是  |int | |[参考requestSource说明](http://apidoc.beta1.fn/index.php/apiview-9 \"参考requestSource说明\")   |\r\n\r\n **返回示例**\r\n\r\n```\r\n{\r\n    \"elapsedTime\": \"0.2017\",\r\n    \"errorCode\": 0,\r\n    \"errorDesc\": \"成功\",\r\n	\"body\": {\r\n    }\r\n}\r\n```\r\n\r\n **返回参数说明**\r\n\r\n\r\n **备注**\r\n\r\n\r\n',0,5,6,'2016-03-08 15:56:43','2016-03-08 15:56:43'),
